import React, { Component } from 'react'

export default class User extends Component {
    render() {
        return (
            <React.Fragment>
                <div className="mainBg">
                    <form>
                        <label>User Id</label>
                        <input type="text" ></input>
                    </form>
                </div>
            </React.Fragment>
        )
    }
}
